var num_imgs=3;
var img=-1;
function imgs(){
	if(img<num_imgs){
		img+=1;
	}else{
		img=0;
	}
	$('#photo').fadeOut(0);
	document["photo"].src=imagens[img];
	$('#photo').fadeIn(500);
	var x=setTimeout("imgs()", 8000);
} // Troca de Imagens
