// REQUISIÇÕES AJAX

function topo_rodape(){
	$.ajax({
		url:'index.html',
		success:function(rodape){
			rodape=$(rodape).find('div#rodape');
			$('#rodape').html(rodape);
		}
	});
	$.ajax({
		url:'index.html',
		success: function(topo){
			topo=$(topo).find('div#topo');
			$('#topo').html(topo);
		},
		error: function(){
			alert('Ocorreu um erro ao inicializar o site. \u00c9 preciso atualizar a p\u00e1gina.');
		}
	});
}